import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import './RegistrationPage.css';

const RegistrationPage = () => {
  const [firstName, setFirstName] = useState('');
  const [lastName, setLastName] = useState('');
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');
  const [phoneNo, setPhoneNo] = useState('');
  const [role, setRole] = useState('USER');
  const [error, setError] = useState({});
  const navigate = useNavigate();

  const validateName = (name) => /^[A-Z][a-zA-Z]{2,}$/.test(name);

  const validateEmail = (email) => /^[A-Za-z0-9._%+-]+@nucleusteq\.com$/.test(email);

  const validatePassword = (password) => /^(?=.*[0-9])(?=.*[a-zA-Z]).{4,}$/.test(password);

  const validatePhoneNumber = (phoneNo) => /^[9876]\d{9}$/.test(phoneNo);

  const handleRegister = async (e) => {
    e.preventDefault();
    const errors = {};

    if (!validateName(firstName)) {
      errors.firstName = 'First name must start with a capital letter, have no spaces, digits, or special characters, and be at least 3 characters long';
    }

    if (!validateName(lastName)) {
      errors.lastName = 'Last name must start with a capital letter, have no spaces, digits, or special characters, and be at least 3 characters long';
    }

    if (!validateEmail(email)) {
      errors.email = 'Email is required and must end with @nucleusteq.com';
    }

    if (!validatePassword(password)) {
      errors.password = 'Password must contain at least 4 characters and 1 number';
    }

    if (!validatePhoneNumber(phoneNo)) {
      errors.phoneNo = 'Phone number must start with 9, 8, 7, or 6 and contain 10 digits';
    }

    if (Object.keys(errors).length > 0) {
      setError(errors);
      return;
    }
    const encodedPassword = btoa(password);
    try {
      const response = await fetch('http://localhost:100/users/register', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
        },
        body: JSON.stringify({ firstName, lastName, email, encodedPassword, phoneNo, role }),
      });

      const data = await response.json();

      if (response.ok) {
        navigate(role === 'USER' ? '/user-dashboard' : '/restaurant-dashboard');
      } else {
        setError({ server: data.message || 'Registration failed' });
      }
    } catch (error) {
      setError({ server: 'An error occurred. Please try again.' });
    }
  };

  return (
    <div className="register-container">
      <h2>Register</h2>
      {error.server && <p className="error">{error.server}</p>}
      <form onSubmit={handleRegister}>
        <div className="form-group">
          <label>First Name:</label>
          <input
            type="text"
            value={firstName}
            onChange={(e) => setFirstName(e.target.value)}
          />
          {error.firstName && <p className="error">{error.firstName}</p>}
        </div>
        <div className="form-group">
          <label>Last Name:</label>
          <input
            type="text"
            value={lastName}
            onChange={(e) => setLastName(e.target.value)}
          />
          {error.lastName && <p className="error">{error.lastName}</p>}
        </div>
        <div className="form-group">
          <label>Email:</label>
          <input
            type="email"
            value={email}
            onChange={(e) => setEmail(e.target.value)}
          />
          {error.email && <p className="error">{error.email}</p>}
        </div>
        <div className="form-group">
          <label>Password:</label>
          <input
            type="password"
            value={password}
            onChange={(e) => setPassword(e.target.value)}
          />
          {error.password && <p className="error">{error.password}</p>}
        </div>
        <div className="form-group">
          <label>Phone Number:</label>
          <input
            type="text"
            value={phoneNo}
            onChange={(e) => setPhoneNo(e.target.value)}
          />
          {error.phoneNo && <p className="error">{error.phoneNo}</p>}
        </div>
        <div className="form-group">
          <label>Role:</label>
          <select
            value={role}
            onChange={(e) => setRole(e.target.value)}
          >
            <option value="USER">User</option>
            <option value="RESTAURANT_OWNER">Restaurant Owner</option>
          </select>
        </div>
        <button type="submit" className="btn-submit">Register</button>
      </form>
    </div>
  );
};

export default RegistrationPage;
